description:
Three beautiful sisters explore their innermost sexual desires and deepest, naughtiest secrets. In the shadows of a troubled family, Ann Marie Rios, the sexy middle sister, controls her wide impulses, insisting her little sister Selena, suppress her own curious desires as well. Ariella is the slutty older sister living her lusty fantasies to the extreme, constantly engaged in wildly sinful exploits, and ready to expose Selena to her delicious world of decadence. Selena must make a choice between innocent virtue and passionate need, knowing that what she wants will lead her into horny temptation. 

